El procedimiento se realizó en, el sector Barrio Sucre vía principal frente al local comercial azucarados  mcpo. San Cristóbal de la entidad tachirense . 

El aprehendido quedó identificado cómo:

Alvaro Solano (33) 

El caso fue puesto a la orden del Ministerio Público.
