Funcionarios del @dcdo.monagas efectuaron un dispositivo de seguridad, donde aprehendieron a José Alberto Fabian Chaparro (34) y José Luis Medina (40), en el sector Campo Alegre, parroquia Las Cocuizas, municipio Maturin, Estado Monagas. A quien se le detuvo por el delito de presunto microtráfico ilícito de sustancias estupefacientes y psicotrópicas.

En el procedimiento se incautó 15 envoltorios de presunta marihuana con un peso aproximado de 43 gramos
.
