El sistema aerosuspendido #aerovia realizó las primeras pruebas de movilización de sus cabinas.

Portavoces de la Autoridad de Tránsito Municipal ATM aseguran solo falta un 35 % de la obra, por lo que en  julio de 2020 estaría funcionando al público, como una de las obras por el bicentenario de Guayaquil.

Actualmente se trabaja en el tendido del cableado que irá en las bases instaladas en el #ríoguayas que unirán #Guayaquil y #Durán.

Se estima que la aerovía movilizará 40 mil pasajeros diariamente entre ambos cantones a no mas de 15 a 20 minutos. Tendrá 5 estaciones, 4 en Guayaquil y 1 en Durán.

